import React, { Component } from 'react';
import Customer from './components/Customer'
import './App.css';

// INSERT VALUE
const customers = [
  {
  'id': 1,
  'image': 'https://placeimg.com/64/64/any',
  'name': '이승찬',
  'birthday': '960208',
  'gender': '남자',
  'job': '취준생'
  },
  {
  'id': 2,
  'image': 'https://placeimg.com/64/64/any',
  'name': '너구리',
  'birthday': '960000',
  'gender': '남자',
  'job': '취준생'
  }
]

// Customer
class App extends Component {
  render() {
    return (
      <Customer 
        id={customers.id}
        image={customers.image}
        name={customers.name}
        birthday={customers.birthday}
        gender={customers.gender}
        job={customers.job}
      />
    );
  }
}

// Public Option
export default App;
